import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css"
import Navbar from "./components/navbar.component"
import ExercisesList  from "./components/ExercisesList.component";
import EditExercise  from "./components/edit-exercise.component";
import CreateExercise from "./components/create-exercise.component";
import CreateUser from "./components/create-user.component";


function App() {
  return (
    <Router>
   <Navbar />
   <br/>
   <Router path= "/" exact component ={ExercisesList}/>
   <Router path= "edit/:id"  component ={EditExercise}/>
   <Router path= "/create"  component ={CreateExercises}/>
   <Router path= "/user"  component ={CreateUser}/>

    </Router>
  );
}

export default App;
